import "./Hotel.css";
import dataHotel from "../../../../data/hotel_list.json";
const Hotel = () =>
{

  return (
    <div>
      <h2 className="title">Homes guests love</h2>
      <div className="hotel">
        {dataHotel.map((item, index) =>
        {
          return (
            <div key={index} className="card-hotel">
              <img src={item.image_url} alt={item}></img>
              <a href="/detail">{item.name}</a>
              <p>{item.city}</p>
              <h3>Starting from ${item.price}</h3>
              <div className="rate">
                <h4>{item.rate}</h4>
                <p>{item.type}</p>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};
export default Hotel;
